import React from 'react';

class Signup extends React.Component {

	render() {
		return(
      <div className='AvatarDiv'>
      <h3>Реєстрація</h3>
      <div>
      <div>Email</div>
      <input id="email" placeholder="Ваш Email.." type="text"/>
      </div>
      <div>
      <div>Password</div>
      <input id="password" placeholder="Ваш пароль.." type="text"/>
      </div>
      <button style={{margin: '10px'}} onClick={this.signUp}>Зареєструватися</button>
      </div>
			)
	}
}

export default Signup;
